import React from "react";
import TodoList from "./components/todoList.component";

const todoItems: Array<Todo> = [
  { text: "sleep", completedStatus: false },
  { text: "movies", completedStatus: true },
];

function App() {
  return (
    <div>
      <TodoList todo={todoItems[0]} />
    </div>
  );
}

export default App;
